using System.Net.Http.Json;
using Microsoft.AspNetCore.Mvc.Testing;
using MRB.Api.Contracts;
using MRB.Api;

namespace MRB.Tests.Integration
{
    [TestFixture]
    public class DeliveryPersonEndpointsTests
    {
        private WebApplicationFactory<Program> _factory;

        [SetUp]
        public void Setup()
        {
            _factory = new WebApplicationFactory<Program>();
        }
        
        [TearDown]
        public void TearDown()
        {
            _factory.Dispose();
        }

        [Test]
        public async Task Post_CreateDeliveryPerson_ReturnsCreated()
        {
            var client = _factory.CreateClient();
            
            var request = new CreateDeliveryPersonRequest
            {
                Identificador = "entregador-it-1",
                Nome = "Jo√£o",
                Cnpj = "12345678901",
                Data_Nascimento = System.DateTime.UtcNow.AddYears(-25),
                Numero_Cnh = "1234567890",
                Tipo_Cnh = MRB.Domain.Enums.DriverLicense.A,
                Imagem_Cnh = ""
            };
            var response = await client.PostAsJsonAsync("/entregadores", request);
            Assert.That(response.StatusCode, Is.EqualTo(System.Net.HttpStatusCode.Created));
        }
    }
}
